import Footer from "../../components/Footer/Footer";
import Header from "../../components/Header/Header";

import style from './MainPage.module.css';

const MainPage = () => {

    return (
        <div className={style['main-page']}>
            <Header />
            <Footer />
            
        </div>
    );

}
export default MainPage;
